INSERT INTO `cj_account_group` VALUES (1,'Los Angeles Honda Dealer','2012-02-20 06:30:19','2013-02-19 05:08:00',600,'','','(813) 408-3372','','','','','','','','flat',NULL,'2012-02-20','<h3>Credit Jeeves Decline to Deal Program</h3><p>Welcome to the Decline to Deal Program by Credit Jeeves. We hope you find our consumer credit simulation and optimization program quickly increases your Auto Sales and Auto Loans at your Dealership. Enrollment is easy. Just agree to the following to get started right away.</p><br><h3>Service Provider Agreement</h3><p><b>Product:</b> Credit Jeeves Decline to Deal Program</p><br><p><b>Term & Renewal:</b> Client agrees to use Credit Jeeves as its provider of credit education, simulation and monitoring solution and related products and services for a minimum term of twelve (12) months.  This agreement shall automatically renew for additional periods of twelve (12) months each, unless either party gives written notice to the other party at least 60 days in advance.  Client is responsible for paying for leads qualified in the service up to 90 after termination. Credit Jeeves must receive cancelation notice via certified mail, fax or email.</p><br><p><b>Advertising, Marketing Approval:</b> All marketing for the Credit Jeeves software must be approved in writing by Credit Jeeves. Credit Jeeves is not in the business of credit repair and must not be marketed as credit repair, promise consumers results or act in a misleading manner examples of things we cannot say  “Credit problems? No problem!”, “We can remove  bankruptcies, judgments, liens, and bad loans from your credit file forever!” “We can erase your bad credit — 100% guaranteed.” “Create a new credit identity — legally.” Client must not bill consumer for the Credit Jeeves program.</p><br><p>Re-qualified lead is based on achieving dealer target score.</p><br><p><b>Invoicing:</b> Payable upon receipt of invoice.</p><br><p><b>Dealer is responsible for:</b><br>a) Identifying a Dealer administrator to manage the program and track the implementation process, training and to ensure regulatory compliance<br>b) Protecting the security and confidentiality of all non-public Consumer information provided by Credit Jeeves</p><br><p>Credit Jeeves agrees to follow industry recognized safeguards to protect the confidentiality and security of the Dealer’s access codes to prevent any unauthorized use.</p><br><p>Credit Jeeves represents it maintains physical electronic and procedural safeguards to maintain confidentiality of all non-public consumer data.</p><br><p><b>We both agree:</b><br>a) To not disclose to 3rd parties each others confidential information <br>b) To comply with all applicable state and federal privacy and other laws governing disclosure of non-public personal information of consumers as well as the requirements of the Gramm Leach Bliley Act and the Safeguards Rule (16 CFR § 314 et seq.) and the federal Fair Credit Reporting Act (15 U.S.C. 1681 et seq.)<br>b) Credit Jeeves owns the rights & title to the Credit Jeeves software and Dealer will use software in accordance with limited license granted<br>c) A breaching party indemnifies and holds the other party harmless against any claims or liabilities arising out of the breach or for any unauthorized use of product or consumer data<br>d) We have the requisite authority to enter into this agreement</p>\r\n<h3>Program Pricing</h3><b>Implementation Fee:</b> Waived\r\n<b>Monthly Rate:</b> Waived\r\n<b>Re-qualified Lead Fee:</b> $300 per re-qualified lead\r\n<br>',NULL,'E0H1CIK68O',141,3,'vehicle','Los Angeles Ho'),(2,'Santa Barbara BMW Dealer','2012-02-20 06:30:40','2012-02-20 06:30:40',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'flat',NULL,'2012-02-20',NULL,NULL,'E0H1CIK9FG',143,NULL,'vehicle','Santa Barbara '),(3,'San Francisco Apartment Rental','2012-02-20 06:31:23','2012-02-20 06:31:23',NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,NULL,'flat',NULL,'2012-02-20',NULL,NULL,'E0H1CIKC93',1