INSERT INTO `cj_settings` VALUES (1,'LYcLeS5ieWuoX5n+vPY3GcTUFtobd86xVEexzHI/7VFfBZksM2NQxczFu8GrDu1lmDvMf3t05vSt7M5Jw3J9Cg==','uvzrzV024jBbGB74YAx3DAXYlB0XyF1wXwgbRlCBtTM=','X8m/OiTqsSC9v6Yn4PkKQC/rcsr6XbyfmQ9xq0g7900=','uvzrzV024jBbGB74YAx3DAXYlB0XyF1wXwgbRlCBtTM=','2013-10-23 21:53:50','<h3>Credit Jeeves Decline to Deal Program</h3><p>Welcome to the Decline to Deal Program by Credit Jeeves. We hope you find our consumer credit simulation and optimization program quickly increases your Auto Sales and Auto Loans at your Dealership. Enrollment is easy. Just agree to the following to get started right away.</p><br><h3>Service Provider Agreement</h3><p><b>Product:</b> Credit Jeeves Decline to Deal Program</p><br><p><b>Term & Renewal:</b> Client agrees to use Credit Jeeves as its provider of credit education, simulation and monitoring solution and related products and services for a minimum term of twelve (12) months.  This agreement shall automatically renew for additional periods of twelve (12) months each, unless either party gives written notice to the other party at least 60 days in advance.  Client is responsible for paying for leads qualified in the service up to 90 after termination. Credit Jeeves must receive cancelation notice via certified mail, fax or email.</p><br><p><b>Advertising, Marketing Approval:</b> All marketing for the Credit Jeeves software must be approved in writing by Credit Jeeves. Credit Jeeves is not in the business of credit repair and must not be marketed as credit repair, promise consumers results or act in a misleading manner examples of things we cannot say  “Credit problems? No problem!”, “We can remove  bankruptcies, judgments, liens, and bad loans from your credit file forever!” “We can erase your bad credit — 100% guaranteed.” “Create a new credit identity — legally.” Client must not bill consumer for the Credit Jeeves program.</p><br><p>Re-qualified lead is based on achieving dealer target score.</p><br><p><b>Invoicing:</b> Payable upon receipt of invoice.</p><br><p><b>Dealer is responsible for:</b><br>a) Identifying a Dealer administrator to manage the program and track the implementation process, training and to ensure regulatory compliance<br>b) Protecting the security and confidentiality of all non-public Consumer information provided by Credit Jeeves</p><br><p>Credit Jeeves agrees to follow industry recognized safeguards to protect the confidentiality and security of the Dealer’s access codes to prevent any unauthorized use.</p><br><p>Credit Jeeves represents it maintains physical electronic and procedural safeguards to maintain confidentiality of all non-public consumer data.</p><br><p><b>We both agree:</b><br>a) To not disclose to 3rd parties each others confidential information <br>b) To comply with all applicable state and federal privacy and other laws governing disclosure of non-public personal information of consumers as well as the requirements of the Gramm Leach Bliley Act and the Safeguards Rule (16 CFR § 314 et seq.) and the federal Fair Credit Reporting Act (15 U.S.C. 1681 et seq.)<br>b) Credit Jeeves owns the rights & title to the Credit Jeeves software and Dealer will use software in accordance with limited license granted<br>c) A breaching party indemnifies and holds the other party harmless against any claims or liabilities arising out of the breach or for any unauthorized use of product or consumer data<br>d) We have the requisite authority to enter into this agreement</p>\r\n<h3>Program Pricing</h3><b>Implementation Fee:</b> Waived\r\n<b>Monthly Rate:</b> Waived\r\n<b>Re-qualified Lead Fee:</b> $300 per re-qualified lead\r\n<br>','<h3>A Summary of Your Rights Under the Fair Credit Reporting Act</h3>\r\nThe federal Fair Credit Reporting Act (FCRA) promotes the accuracy, fairness, and privacy of information in the files of consumer reporting agencies. There are many types of consumer reporting agencies, including credit bureaus and specialty agencies (such as agencies that sell information about check writing histories, medical records, and rental history records).Here is a summary of your major rights under the FCRA. For more information, including information about additional rights, go to www.ftc.gov/credit or write to: Consumer Response Center, Room 130-A, Federal Trade Commission, 600 Pennsylvania Ave. N.W., Washington, D.C. 20580.\r\n<ul>\r\n<li><b>You must be told if information in your file has been used against you.</b> Anyone who uses a credit report or another type of consumer file to deny your application for credit, insurance, or employment - or to take another adverse action against you - must tell you, and must give you the name, address, and phone number of the agency that provided the information.</li>\r\n<li><b>You have the right to know what is in your file.</b> You may request and obtain all the information about you in the files of a consumer reporting agency (your \"file disclosure\"). You will be required to provide proper identification, which may include your Social Security number. In many cases, the disclosure will be free. You are entitled to a free file disclosure if: a person has taken adverse action against you because of information in your credit file; you are the victim of identify theft and place a fraud alert in your file; your file contains inaccurate information as a result of fraud; you are on public assistance; you are unemployed but expect to apply for employment within 60 days. In addition, by September 2005 all consumers will be entitled to one free disclosure every 12 months upon request from each nationwide credit bureau and from nationwide specialty consumer reporting agencies. See www.ftc.gov/credit for additional information.</li>\r\n<li><b>You have the right to ask for a credit score.</b> Credit scores are numerical summaries of your credit-worthiness based on information from credit bureaus. You may request a credit score from consumer reporting agencies that create scores or distribute scores used in residential real property loans, but you will have to pay for it. In some mortgage transactions, you will receive credit score information for free from the mortgage lender.</li>\r\n<li><b>You have the right to dispute incomplete or inaccurate information.</b> If you identify information in your file that is incomplete or inaccurate, and file it to the consumer reporting agency, the agency must investigate unless your dispute is frivolous. See www.ftc.gov/credit for an explanation of dispute procedures.</li>\r\n<li><b>Consumer reporting agencies must correct or delete inaccurate, incomplete, or unverifiable information.</b> Inaccurate, incomplete or unverifiable information must be removed or corrected, usually within 30 days. However, a consumer reporting agency may continue to file information it has verified as accurate.</li>\r\n<li><b>Consumer reporting agencies may not report outdated negative information.</b> In most cases, a consumer reporting agency may not report negative information that is more than seven years old, or bankruptcies that are more than 10 years old.</li>\r\n<li><b>Access to your file is limited.</b> A consumer reporting agency may provide information about you only to people with a valid need -- usually to consider an application with a creditor, insurer, employer, landlord, or other business. The FCRA specifies those with a valid need for access.</li>\r\n<li><b>You must give your consent for reports to be provided to employers.</b> A consumer reporting agency may not give out information about you to your employer, or a potential employer, without your written consent given to the employer. Written consent generally is not required in the trucking industry. For more information, go to www.ftc.gov/credit.</li>\r\n<li><b>You may limit \"prescreened\" offers of credit and insurance you get based on information in your credit file.</b> Unsolicited \"prescreened\" offers for credit and insurance must include a toll-free phone number you can call if you choose to remove your name and address from the lists these offers are based on. You may opt-out with the nationwide credit bureaus at 1-888-5-OPTOUT (1-888-567-8688).</li>\r\n<li><b>You may seek damages from violators.</b> If a consumer reporting agency, or, in some cases, a user of consumer reports or a furnisher of information to a consumer reporting agency violates the FCRA, you may be able to sue in state or federal court.<li>\r\n<li><b>Identity theft victims and active duty military personnel have additional rights.</b> For more information, visit www.ftc.gov/credit.</li>\r\n</ul>\r\nStates may enforce the FCRA, and many states have their own consumer reporting laws. In some cases, you may have more rights under state law. For more information, contact your state or local consumer protection agency or your state Attorney General. For federal information, contact the Federal Trade Commission: Consumer Response Center - FCRA Washington, DC 20580 1-877-382-4357');
