INSERT INTO `email_translation` VALUES (1,1,'en','subject','Welcome to Credit Jeeves'),(2,1,'en','body','{% extends \"CoreBundle:Mailer:base.html.twig\" %}{% block h1 %}Welcome to Credit Jeeves{% endblock %}\n{% block email %}\n      <p>\n          {{ groupName }} has teamed up with Credit Jeeves to help you understand your credit score and achieve your financing goals.\n          The Credit Jeeves program shows you your current credit score, a summary of your credit profile, and a customized action plan to help\n          you reach your target score. We then monitor your progress over the next few months to let you know when you are likely qualified for a loan.\n      </p>\n      <p>\n          Enrollment is free, simple, and takes less than a minute. Credit Jeeves will not negatively impact your credit and does not post a\n          \'hard inquiry.\'\n      </p>\n      <p>\n          Set up your Credit Jeeves Account now at <a href=\"{{ inviteLink }}\">{{ inviteLink }}</a> and take the first step towards better financing.\n      </p>\n      <p>\n          You will be able to:\n          * See and monitor your current credit score.\n          * Follow easy-to-understand actions to optimize your score for your goals.\n          * See a summary of your credit file and learn more about how this information affects your score.\n          * Receive alerts when you reach your target score.\n      </p>\n      <br />\n      <p>\n        Tip: Do not shop around for a loan right now. This will create multiple \'hard inquiries\' on your credit file which can negatively\n        impact your score. Credit Jeeves makes a \'soft inquiry\' and will allow you to view your score and action plan without hurting your\n        chances to requalify for a loan in the future.\n      </p>\n      <p>\n          Again, {{ groupName }} is providing you this service for free.\n      </p>\n      <p>\n      Sign Up Now at <a href=\"{{ inviteLink }}\">{{ inviteLink }}</a>\n      </p>\n{% endblock %}'),(3,2,'en','subject','Welcome to Credit Jeeves'),(4,2,'en','body','{% extends \"CoreBundle:Mailer:base.html.twig\" %}{% block h1 %}Welcome to CreditJeeves{% endblock %}{% block email %}<p>You have taken the first step towards your new car.</p><p>To see your customized action plan, sign in at <a href=\"http://my.creditjeeves.com/\">cj</a> anytime.</p><strong>Get started today:</strong><ul>  <li>Understand<a href=\"http://www.creditjeeves.com/educate/understand-your-credit-score\">how your credit score is determined</a></li><li>Review your <a href=\"http://cj/_dev.php/?\">action plan</a> and decide what step you will take first.</li><li>Click on the \"learn more\" link next to that step to find out what to do.</li></ul><i>Trouble answering the verification questions?</i><p>It is a good idea to get a <a href=\"https://www.annualcreditreport.com/\"> free copy of your credit report </a> to see if contains something you do not recognize. You can also contact <a href=\"mailto:help@creditjeeves.com\">help@creditjeeves.com</a> if your account becomes locked. </p><i>We want to hear from you!</i><p>Please <a href=\"http://creditjeeves.uservoice.com/\">send us your feedback</a> on how we can make the product better for you.</p>{% endblock %}'),(5,3,'en','subject','Your Credit Score has Changed - Log Into Credit Jeeves'),(6,3,'en','body','{% extends \"CoreBundle:Mailer:base.html.twig\" %}'),(9,5,'en','subject','One of your leads has reached the Target Score'),(10,5,'en','body','{% extends \"CoreBundle:Mailer:base.html.twig\" %}'),(11,6,'en','subject','One of your leads has reached the Target Score'),(12,6,'en','body','{% extends \"CoreBundle:Mailer:base.html.twig\" %}'),(13,7,'en','subject','Example email with all avaliable fields'),(14,7,'en','body','{% extends \"CoreBundle:Mailer:base.html.twig\" %}{% block h1 %}Heading 1{% endblock %}{% block h2 %}Heading 2{% endblock %}{% block h3 %}Heading 3{% endblock %}{% block h4 %}Heading 4{% endblock %}{% block email %}{% set button = {\"text\": \"Hmm, we could add more than one button in the email body!\",\"value\": \"Test\",\"link\": \"#\"} %}{% include \"CoreBundle:Mailer:button.html.twig\" with button %}<p>Lorem ipsum...</p>{% set button = {\"text\": \"Some text above button\", \"value\": \"Click It\", \"link\": \"#\"} %}{% include \"CoreBundle:Mailer:button.html.twig\" with button %}{% endblock %}'),(15,8,'en','subject','Reset Password'),(16,8,'en','body','{% extends \"CoreBundle:Mailer:base.html.twig\" %}\n{% block h1 %}Hi {{ user.full_name }}!{% endblock %}\n{% block email %}\n  You recently asked to reset your password.\n  <a href=\"{{ confirmationUrl }}\">Click here to change your password.</a>\n\n  Didn\'t request this change?\n  If you didn\'t request a new password, please contact us at <a mailto=\"help@renttrack.com\">help@renttrack.com</a>.\n\n  RentTrack will never e-mail you and ask you to disclose or verify your RentTrack.com password, credit card, or banking account number.\n\n  Thank you for using RentTrack!\n{% endblock %}\n'),(17,9,'en','subject','Check Email'),(18,9,'en','body','{% extends \"CoreBundle:Mailer:base.html.twig\" %}\n{% block h1 %}Your Credit Jeeves account is almost ready!{% endblock %}\n{% block email %}Hello {{ user.full_name }},\n<br /><br />\nPlease visit <a href=\"{{ checkUrl }}\">{{ checkUrl }}</a> to confirm your registration.\n<br /><br />\nSee you soon!\n{% endblock %}\n'),(19,10,'en','subject','Receipt from Credit Jeeves'),(20,10,'en','body','<div mc:edit=\"std_content00\">\n<h1 class=\"h1\">Receipt from Credit Jeeves</h1>\nThank you for purchasing your credit report through Credit Jeeves.\nYour payment was processed successfully and will appear on your next statement under CREDITJEEVE.\nHere is your receipt:<br />\n&nbsp;<br />\n<hr />\nPayment Date & Time:&nbsp;{{ date }}<br />\nPayment Amount: {{ amout }}<br />\nReference Number: {{ number }}<br />\n<br />\n<hr />\nRemember, we\'re here to help,<br /><strong>The Credit Jeeves Team</strong>\n</div>\n'),(21,11,'en','subject','Get Started with RentTrack'),(22,11,'en','body','{% extends \"RjComponentBundle:Mailer:base.html.twig\" %}\r\n{% block h1 %}Your RentTrack account is almost ready!{% endblock %}\r\n{% block email %}\r\nHello {{ user.full_name }},\r\n<br /><br />\r\nPlease visit <a href=\"{{ checkUrl }}\">{{ checkUrl }}</a> to confirm your registration.\r\n<br /><br />\r\nSee you soon!\r\n{% endblock %}'),(23,12,'en','subject','Your Tenant is Ready to Pay Rent through RentTrack'),(24,12,'en','body','{% extends \"RjComponentBundle:Mailer:base.html.twig\" %}\n{% block h1 %}Get Paid Fast Using RentTrack{% endblock %}\n{% block email %}\n  {% if nameLandlord %}\n      Hi {{ nameLandlord }}! <br />  <br />\n  {% else %}\n      Hello!  <br /> <br /> \n  {% endif %}\n  Your tenant, {{ fullNameTenant }}, would like to use RentTrack to pay rent on your property at\n  {{ address }} {{ unitName }}. RentTrack allows {{ nameTenant }} to build credit history by\n  reporting on-time payments to credit bureaus. <br /> <br />\n\n  As a landlord, you benefit because RentTrack facilitates easy payments through secure electronic\n  check transfers and credit cards - payments are deposited faster and directly to your account.\n  Reminders are sent automatically to your tenants before rent is due and late notices are sent\n  to you immediately. If you have multiple properties, you can see the status of your payments\n  all in one place. To top it off, your tenant has an additional incentive to pay\n  on time each month.<br /> <br />\n\n  Ready to get paid? <br /> <br />\n  <a id=\"payRentLinkLandlord\"\n  {% if inviteCode %}\n    href=\"http://{{ serverName }}{{ path(\'landlord_invite\', {\'code\': inviteCode }) }}\"\n  {% else %}\n    href=\"http://{{ serverName }}/\"\n  {% endif %}\n            style=\"border: none;\n            padding: 2px 7px;\n            text-align: left;\n            color: white;\n            font-size: 14px;\n            text-shadow: 1px 1px 3px #636363;\n            filter: dropshadow(color=#636363, offx=1, offy=1);\n            cursor: pointer;\n            background-color: #669900;\n            -ms-filter: \'progid:DXImageTransform.Microsoft.gradient(startColorstr=#00ffffff,endColorstr=#00ffffff)\';\n            filter: progid:DXImageTransform.Microsoft.gradient(startColorstr=#00ffffff, endColorstr=#00ffffff);\n            zoom: 1;\n            text-decoration: none;\n            -moz-border-radius: 4px;\n            -webkit-border-radius: 4px;\n            border-radius: 4px;\"\n>Sign up</a> Still have some questions? <a href=\"http://www.renttrack.com/property-management\">Read More</a> or call 866.841.9090\n{% endblock %}\n'),(25,13,'en','subject','Your Landlord is Requesting Rent Payment through RentTrack'),(26,13,'en','body','{% extends \"RjComponentBundle:Mailer:base.html.twig\" %}\n{% block h1 %}Pay Rent. Built Credit History.{% endblock %}\n{% block email %}\n  {% if nameTenant %}\n      Hi {{ nameTenant }}! <br />  <br />\n  {% else %}\n      Hello!  <br /> <br />\n  {% endif %}\n  Your landlord, {{ fullNameLandlord }}, would like you to use RentTrack to pay your rent or renew your contract for\n  {{ address }}{% if unitName != \'SINGLE_PROPERTY\' %} {{unitName}}{%endif%}. RentTrack makes it easy to pay rent through secure electronic check transfers\n  and credit card payments - you get to choose. You also have the opportunity to build credit history by signing up for\n  credit bureau payment reporting.\n  <br /> <br />\n\n  Ready to get the most out of your rent payments?<br /> <br />\n  <a id=\"payRentLink\"\n  {% if inviteCode %}\n    href=\"http://{{ serverName }}{{ path(\'tenant_invite\', {\'code\': inviteCode, \'isImported\': isImported }) }}\"\n  {% else %}\n    href=\"http://{{ serverName }}/\"\n  {% endif %}\n    style=\"\n                  border: none;\n                  padding: 2px 7px;\n                  text-align: left;\n                  color: white;\n                  font-size: 14px;\n                  text-shadow: 1px 1px 3px #636363;\n                  filter: dropshadow(color=#636363, offx=1, offy=1);\n                  cursor: pointer;\n                  background-color: #669900;\n                  -ms-filter: \'progid:DXImageTransform.Microsoft.gradient(startColorstr=#00ffffff,endColorstr=#00ffffff)\';\n                  filter: progid:DXImageTransform.Microsoft.gradient(startColorstr=#00ffffff, endColorstr=#00ffffff);\n                  zoom: 1;\n                  text-decoration: none;\n                  -moz-border-radius: 4px;\n                  -webkit-border-radius: 4px;\n                  border-radius: 4px;\n          \">Pay Rent</a> Still have some questions? <a href=\"http://www.renttrack.com/how-it-works\">Learn More</a>\n{% endblock %}\n'),(27,14,'en','subject','Your Rent Payment is Late'),(28,14,'en','body','{% extends \"RjComponentBundle:Mailer:base.html.twig\" %}\n{% block h1 %}Your Rent is Late. Pay Now!{% endblock %}\n{% block email %}\n  {% if nameTenant %}\n      Dear {{ nameTenant }}, <br />  <br />\n  {% else %}\n      Heads Up!<br /> <br />\n  {% endif %}\n  It looks like {{ fullNameLandlord }} expected your rent payment for {{ address }} {{ unitName }} already.\n\n  <a href=\"http://my.renttrack.com/\">Log in to RentTrack today</a> and and make an immediate payment. We\'ll\n  let {{ fullNameLandlord }} that rent is on its way once the payment goes through.\n\n  Better yet, you can set up automatic payments so you never miss one again. <a href=\"https://renttrack.uservoice.com/knowledgebase/articles/263021-how-do-i-set-up-automatic-payments-\">Learn More</a>\n\n  Watching out for you,\n  The RentTrack Team\n{% endblock %}\n'),(29,15,'en','subject','Your Landlord Joined RentTrack'),(30,15,'en','body','{% extends \"RjComponentBundle:Mailer:base.html.twig\" %}\r\n      {% block h1 %}Hi {{ nameTenant }}!{% endblock %}\r\n      {% block email %}\r\n        Congratulations! {{ fullNameLandlord }} has teamed up with RentTrack.\r\n        <br /><br />\r\n        We\'re now working with them to ready their account to accept payments. You\'ll receive another email when you\'re\r\n        approved to pay rent online.\r\n        <br /><br />\r\n        Thank you for your patience!\r\n      {% endblock %}'),(31,16,'en','subject','Your Tenant Needs Approval'),(32,16,'en','body','{% extends \"RjComponentBundle:Mailer:base.html.twig\" %}\n{% block h1 %}Hi {{ nameLandlord }}!{% endblock %}\n{% block email %}\n  {{ nameTenant }} is ready to pay rent for {{ address }}\n  <br /></br />\n  Please <a href=\"http://my.renttrack.com/\">log in to RentTrack</a>, click on the Tenants tab, and click on the\n  review \"eye\" next to the pending tenant. You will then be able to add rent details and approve the tenant. Once\n  this is complete, your tenant will be able to set up their rent payment.\n{% endblock %}\n'),(33,17,'en','subject','Your have new dealer!'),(34,17,'en','body','{% extends \"CoreBundle:Mailer:base.html.twig\" %}\n{% block h1 %}Your have new dealer!{% endblock %}\n{% block email %}\n    <p>\n        {{ groupName }} has teamed up with Credit Jeeves to help you understand your credit score and achieve your financing goals.\n    </p>\n    <p>\n        Again, {{ groupName }} is providing you this service for free.\n    </p>\n{% endblock %}\n'),(35,18,'en','subject','Daily Payments.'),(36,18,'en','body','{% extends \"RjComponentBundle:Mailer:base.html.twig\" %}\n{% block h1 %}Rent Collected{% endblock %}\n{% block email %}\n  Hi {{ nameLandlord }},\n  <br /><br />\n  We collected ${{ amount }} in rent today. To see your recent payments,\n  <a href=\"https://my.renttrack.com/\">log into RentTrack</a> and click on Dashboard.\n  <br /><br />\n  Payments typically settle in 1-3 days to your account. If you suspect a payment is not transferring, or have\n  any other questions, please contact us at help@creditjeeves.com or call 866-841-9090.\n{% endblock %}\n'),(37,19,'en','subject','Not Paid Today.'),(38,19,'en','body','{% extends \"RjComponentBundle:Mailer:base.html.twig\" %}\n{% block h1 %}Hi {{ nameLandlord }}!{% endblock %}\n{% block email %}\n  Today not paid is {{ amount }}\n  <br />\n  <br />\n  Enjoy, <br />\n  The RentTrack Team\n{% endblock %}\n'),(39,20,'en','subject','RentTrack Daily Report'),(40,20,'en','body','{% extends \"RjComponentBundle:Mailer:base.html.twig\" %}\n{% block h1 %}Hi {{ nameLandlord }}!{% endblock %}\n{% block email %}\n<table \n  width=\"100%\"\n  style=\"\n    border: 1px solid #C8C8C8;\n    border-collapse: collapse;\n \"\n>\n  <thead>\n    <tr\n      style=\"background-color: #F5F5F5; border: 1px solid #C8C8C8;\"\n    >\n      <th style=\"padding:5px;\">Status</th>\n      <th style=\"padding:5px;\">Amount</th>\n    </tr>\n  </thead>\n  <tbody>\n    {% for key, value in report %}\n    <tr style=\"border: 1px solid #C8C8C8;\">\n      <td style=\"padding:5px;\">{{ key }}</td>\n      <td style=\"padding:5px;\">\n      {% if value > 0 %}\n        ${{ value }}\n      {% else %}\n      ---\n      {% endif %}\n      </td>\n    </tr>\n    {% endfor %}\n  </tbody>\n</table>\n{% endblock %}\n'),(41,21,'en','subject','Rent Payment is Late'),(42,21,'en','body','{% extends \"RjComponentBundle:Mailer:base.html.twig\" %}\n{% block h1 %}Hi {{ nameTenant }},{% endblock %}\n{% block email %}\n  It looks like your rent payment for {{ address }} is <b>late by {{ diff }} day(s)</b>.\n  <br /><br />\n  <a href=\"https://my.renttrack.com/\">Log into RentTrack</a> today to make a new payment. We\'d recommend setting up\n  <a href=\"https://renttrack.uservoice.com/knowledgebase/articles/263021-how-do-i-set-up-automatic-payments-\">automatic payments</a>\n  so you won\'t see an email like this next month.\n  <br /><br />\n  If you have alread paid by a different method like cash or (*gasp*) paper check, then your landlord needs\n  to log into RentTrack and update your records. They have also received an email reminder regarding this payment.\n  <br /><br />\n  If you need assistance, please email help@renttrack.com or call (866) 841-9090.\n{% endblock %}\n'),(43,22,'en','subject','Your Rent Is Due'),(44,22,'en','body','{% extends \"RjComponentBundle:Mailer:base.html.twig\" %}\n{% block h1 %}Rent Is Due{% endblock %}\n{% block email %}\nYour rent payment to {{ nameHolding }} for {{ address }} is coming up.\n<br /><br />\n{% if recurring == true %}\n  It looks like you have recurring payments set up, so we\'ll send you another email when we make your payment.\n  If you need to change your payment details or cancel your payment,\n  please <a href=\"https://my.renttrack.com/\">log in to RentTrack today</a> and make any adjustments.\n{% else %}\n  You do not have recurring payments set up. <a href=\"https://my.renttrack.com/\">Log in to RentTrack today</a>\n  to set up a one-time or recurring payment.\n{% endif %}\n{% endblock %}\n'),(45,23,'en','subject','Review Late Rent Payments'),(46,23,'en','body','{% extends \"RjComponentBundle:Mailer:base.html.twig\" %}\n{% block h1 %}Hello {{ nameLandlord }},{% endblock %}\n{% block email %}\nThe following tenants have not submitted on-time payments:\n<table \n  width=\"100%\"\n  style=\"\n    border: 1px solid #C8C8C8;\n    border-collapse: collapse;\n \"\n>\n  <thead>\n    <tr\n      style=\"background-color: #F5F5F5; border: 1px solid #C8C8C8;\"\n    >\n      <th style=\"padding:5px;\">Tenant</th>\n      <th style=\"padding:5px;\">Email</th>\n      <th style=\"padding:5px;\">Address</th>\n      <th style=\"padding:5px;\">Days Late</th>\n    </tr>\n  </thead>\n  <tbody>\n    {% for tenant in tenants %}\n    <tr style=\"border: 1px solid #C8C8C8;\">\n      <td style=\"padding:5px;\">{{ tenant.name }}</td>\n      <td style=\"padding:5px;\">{{ tenant.email }}</td>\n      <td style=\"padding:5px;\">{{ tenant.address }}</td>\n      <td style=\"padding:5px;\">{{ tenant.late }}</td>\n    </tr>\n    {% endfor %}\n  </tbody>\n</table>\n  <br />\n  Please <a href=\"https://my.renttrack.com\">log into RentTrack</a>\n  and click on \"Resolve\" next to late tenants at the top of the Payments Dashboard to either record payments\n  via alternate means or to send them an email reminder.\n{% endblock %}\n'),(47,24,'en','subject','Rent Payment Receipt'),(48,24,'en','body','{% extends \"RjComponentBundle:Mailer:base.html.twig\" %}\n{% block h1 %}Your Rent is Paid{% endblock %}\n{% block email %}\n{% if nameTenant %}\n  Hi {{ nameTenant }}! <br /><br />\n{% else %}\n  Hello!  <br /><br />\n{% endif %}\n\nYour rent payment to {{ groupName }} was sent just now. They should see the deposit in their account in 1-3 days.\n\nThe details:\n\n<table\n  width=\"100%\"\n  style=\"\n    border: 1px solid #C8C8C8;\n    border-collapse: collapse;\n \"\n>\n  <tbody>\n    <tr style=\"border: 1px solid #C8C8C8;\">\n      <td style=\"padding:5px;\">{{ \'order.date.time\' | trans }}:</td><td style=\"padding:5px;\">{{ datetime }}</td>\n    </tr>\n    <tr style=\"border: 1px solid #C8C8C8;\">\n      <td style=\"padding:5px;\">{{ \'order.transaction.id\' | trans }}:</td><td style=\"padding:5px;\">{{ transactionID }}</td>\n    </tr>\n    <tr style=\"border: 1px solid #C8C8C8;\">\n      <td style=\"padding:5px;\">{{ \'amount\' | trans }}:</td><td style=\"padding:5px;\">{{ amount }}</td>\n    </tr>\n    {% if fee > 0 %}\n    <tr style=\"border: 1px solid #C8C8C8;\">\n      <td style=\"padding:5px;\">{{ \'order.fee\' | trans }}:</td><td style=\"padding:5px;\">{{ fee }}</td>\n    </tr>\n    <tr style=\"border: 1px solid #C8C8C8;\">\n      <td style=\"padding:5px;\">{{ \'order.total\' | trans }}:</td><td style=\"padding:5px;\">{{ total }}</td>\n    </tr>\n    {% endif %}\n  </tbody>\n</table>\n</br>\n</br>\n</br>\n{{ \'order.receipt.footer\' | trans }}\n{% endblock %}\n'),(49,25,'en','subject','Order Error'),(50,25,'en','body','{% extends \"RjComponentBundle:Mailer:base.html.twig\" %}\n{% block h1 %}Hi {{ nameTenant }}!{% endblock %}\n{% block email %}\n{{ \'order.error.title\'| trans }}.\n<br /><br />\n{{ \'order.error.message\' | trans }}: {{ error }}\n<br /><br />\n<table\n  width=\"100%\"\n  style=\"\n    border: 1px solid #C8C8C8;\n    border-collapse: collapse;\n \"\n>\n  <tbody>\n    <tr style=\"border: 1px solid #C8C8C8;\">\n      <td style=\"padding:5px;\">{{ \'order.paid.to\' | trans }}:</td><td style=\"padding:5px;\">{{ groupName }}</td>\n    </tr>\n    <tr style=\"border: 1px solid #C8C8C8;\">\n      <td style=\"padding:5px;\">{{ \'order.date.time\' | trans }}:</td><td style=\"padding:5px;\">{{ datetime }}</td>\n    </tr>\n    <tr style=\"border: 1px solid #C8C8C8;\">\n      <td style=\"padding:5px;\">{{ \'amount\' | trans }}:</td><td style=\"padding:5px;\">{{ amount }}</td>\n    </tr>\n    {% if fee > 0 %}\n    <tr style=\"border: 1px solid #C8C8C8;\">\n      <td style=\"padding:5px;\">{{ \'order.fee\' | trans }}:</td><td style=\"padding:5px;\">{{ fee }}</td>\n    </tr>\n    <tr style=\"border: 1px solid #C8C8C8;\">\n      <td style=\"padding:5px;\">{{ \'order.total\' | trans }}:</td><td style=\"padding:5px;\">{{ total }}</td>\n    </tr>\n    {% endif %}\n    <tr style=\"border: 1px solid #C8C8C8;\">\n      <td style=\"padding:5px;\">{{ \'order.id\' | trans }}:</td><td style=\"padding:5px;\">{{ orderId }}</td>\n    </tr>\n    {% if transactionId > 0 %}\n    <tr style=\"border: 1px solid #C8C8C8;\">\n      <td style=\"padding:5px;\">{{ \'order.transaction.id\' | trans }}:</td><td style=\"padding:5px;\">{{ transactionId }}</td>\n    </tr>\n    {% endif %}\n  </tbody>\n</table>\n{{ \'order.contact.us\' | trans }}\n{% endblock %}\n'),(51,26,'en','subject','Your RentTrack Merchant Account is Ready!'),(52,26,'en','body','{% extends \"RjComponentBundle:Mailer:base.html.twig\" %}\r\n      {% block h1 %}Hello {{ fullNameLandlord }},{% endblock %}\r\n      {% block email %}\r\n        Your merchant account for \"{{ groupName }}\" is approved and ready!\r\n\r\n   <br /><br />\r\n\r\n        You can now accept rent payments online, and funds will be deposited into the account\r\n        you specified in your application. Now let’s get your tenants signed up to pay their rent. First, if you have your tenant email addresses, we recommend signing into your RentTrack account and directly \r\n        <a href=\"http://renttrack.uservoice.com/knowledgebase/articles/285491-how-do-i-add-or-invite-a-tenant-\">inviting your tenants</a>. To spread the word we also provide:<ul><li><a href=\"http://www.renttrack.com/downloads/RentTrack-Tenant-Flyer.pdf\">Brochures</a> you can print to post or handout.</li>\r\n<li>Door hangers that can be placed at each unit, or postcards that can be sent out. Just let us know how many to send you.</li></ul>\r\n<br /><br />\r\nIf you would like to add a payment page to your website, we provide <a href=\"http://renttrack.uservoice.com/knowledgebase/articles/293431\">instructions on how you can embed an iframe</a> to tell tenants about the benefits of paying online as well as giving them an easy link to sign up for your properties. \r\n<br /> <br />\r\nIf tenants sign up through our RentTrack.com website, we will notify you so you can <a href=\"http://renttrack.uservoice.com/knowledgebase/articles/275851-how-do-i-approve-a-tenant-so-they-can-pay-rent-\">approve your tenants</a>.\r\n<br /> <br />\r\nIf you have any questions, please do not hesitate to contact us at help@renttrack.com or call 866-841-9090.\r\n      {% endblock %}'),(56,27,'en','subject','You\'re Approved to Pay Rent Online'),(57,27,'en','body','{% extends \"RjComponentBundle:Mailer:base.html.twig\" %}\r\n{% block h1 %}You\'re Approved!{% endblock %}\r\n{% block email %}\r\nHello {{ nameTenant }},\r\n\r\nYour landlord has approved you and you can now set up your rent payment. Please <a href=\"http://my.renttrack.com/\">log in to RentTrack</a> and click on the \"Pay\" button corresponding to your rental. \r\n{% endblock %}'),(67,26,'en','bodyHtml','{% extends \"RjComponentBundle:Mailer:base.html.twig\" %}\r\n      {% block h1 %}Hello {{ fullNameLandlord }},{% endblock %}\r\n      {% block email %}\r\n        Your merchant account for \"{{ groupName }}\" is approved and ready!\r\n\r\n   <br /><br />\r\n\r\n        You can now accept rent payments online, and funds will be deposited into the account\r\n        you specified in your application. Now let’s get your tenants signed up to pay their rent. First, if you have your tenant email addresses, we recommend signing into your RentTrack account and directly \r\n        <a href=\"http://renttrack.uservoice.com/knowledgebase/articles/285491-how-do-i-add-or-invite-a-tenant-\">inviting your tenants</a>. To spread the word we also provide:<ul><li><a href=\"http://www.renttrack.com/downloads/RentTrack-Tenant-Flyer.pdf\">Brochures</a> you can print to post or handout.</li>\r\n<li>Door hangers that can be placed at each unit, or postcards that can be sent out. Just let us know how many to send you.</li></ul>\r\n<br /><br />\r\nIf you would like to add a payment page to your website, we provide <a href=\"http://renttrack.uservoice.com/knowledgebase/articles/293431\">instructions on how you can embed an iframe</a> to tell tenants about the benefits of paying online as well as giving them an easy link to sign up for your properties. \r\n<br /> <br />\r\nIf tenants sign up through our RentTrack.com website, we will notify you so you can <a href=\"http://renttrack.uservoice.com/knowledgebase/articles/275851-how-do-i-approve-a-tenant-so-they-can-pay-rent-\">approve your tenants</a>.\r\n<br /> <br />\r\nIf you have any questions, please do not hesitate to contact us at help@renttrack.com or call 866-841-9090.\r\n      {% endblock %}'),(68,26,'en','fromName',NULL),(69,26,'en','fromEmail',NULL),(70,28,'en','body','\n            {% extends \'RjComponentBundle:Mailer:base.html.twig\' %}\n            {% block h1 %}Dear {{ tenantFullName }},{% endblock %}\n            {% block email %}\n                {% if orderStatus == \'refunded\' %}\n\n                Per your request, your rent of {{ rentAmount }} sent on {{ orderDate }} was refunded and should appear\n                in your account within a few days.\n                {% elseif orderStatus == \'cancelled\' %}\n\n                Your payment of {{ rentAmount }} sent on {{ orderDate }} was cancelled.\n                {% else %}\n\n                Your payment of {{ rentAmount }} sent on {{ orderDate }} was returned. Your rent is currently not paid.\n\n                You will receive a follow up from RentTrack customer support with the reason for return and ways\n                to fix it.\n                {% endif %}\n\n                If you have any other questions, please contact help@renttrack.com or call 866-841-9090 x2.\n            {% endblock %}'),(71,28,'en','subject','RentTrack.com - Your order status has been changed'),(72,30,'en','body','\n             {% extends \"CoreBundle:Mailer:base.html.twig\" %}\n             {% block h1 %}Congratulations!{% endblock %}\n             {% block email %}\n               <div mc:edit=\"std_content00\">\n                   You have reached your dealer\'s target score of <strong>{{ targetScore }}</strong>\n               </div>\n               <div mc:edit=\"latest_score_button\">\n                   <br />\n                   <hr />\n                   Log into Credit Jeeves to find out what to do next. Your new car awaits!\n                   <br />\n                   <a class=\"button\" href=\"{{ loginLink }}\" id=\"viewLatestScoreButton\">View Latest Score</a>\n                   <br />\n                   <hr />\n               </div>\n             {% endblock %}'),(73,30,'en','subject','Your New Car Awaits - Log into Credit Jeeves'),(74,31,'en','body','{% extends \'RjComponentBundle:Mailer:base.html.twig\' %}\n{% block h1 %}Dear {{ landlordFirstName }},{% endblock %}\n{% block email %}\n    {% if orderStatus == \'refunded\' %}\n\n    At the request of {{ tenantName }}, their rent of {{ rentAmount }} sent on {{ orderDate }} was refunded.\n    Any monies already deposited will be deducted from your account within a couple of days.\n    Please contact your tenant if you have any questions regarding this refund.\n    {% elseif orderStatus == \'cancelled\' %}\n\n    At the request of {{ tenantName}}, their rent payment of {{ rentAmount }} sent on {{ orderDate }}\n    was cancelled. You will not see a deposit in your account since it was cancelled before\n    payment settlement. Please contact your tenant if you have any questions regarding this cancellation.\n    {% else %}\n\n    The rent payment by {{ tenantName }} for {{ rentAmount }} sent on {{ orderDate }} was returned.\n    Any monies already deposited  will be deducted from your account per the RentTrack terms of service.\n    Your tenant\'s rent is currently unpaid.\n    Your tenant may try to pay again through RentTrack, or you may arrange an alternate, immediate payment method.\n    {% endif %}\n\n    If you have any other questions, please contact help@renttrack.com or call 866-841-9090 x2.\n{% endblock %}\n'),(75,31,'en','subject','Your Tenant\'s  Rent Payment was Reversed'),(76,31,'en','bodyHtml','{% extends \'RjComponentBundle:Mailer:base.html.twig\' %}\r\n            {% block h1 %}Dear {{ landlordFirstName }},{% endblock %}\r\n            {% block email %}\r\n                {% if orderStatus == \'refunded\' %}\r\n\r\n                Per your tenant\'s request, their rent of {{ rentAmount }} sent on {{ orderDate }} was refunded\r\n                and will be deducted from your account within a couple of days. Please contact your tenant\r\n                if you have any questions regarding this refund.\r\n                {% elseif orderStatus == \'cancelled\' %}\r\n\r\n                Per your your tenant\'s request, their rent payment of {{ rentAmount }} sent on {{ orderDate }}\r\n                was cancelled. You will not see a deposit in your account since it was cancelled before\r\n                payment settlement. Please contact your tenant if you have any questions regarding this cancellation.\r\n                {% else %}\r\n\r\n                Your tenant\'s payment of {{ rentAmount }} sent on {{ orderDate }} was returned. This amount\r\n                has been deducted from your account per the RentTrack terms of service. Your rent is currently not paid.\r\n                Please contact your tenant if to arrange another payment.\r\n\r\n\r\n                RentTrack Customer Support will also reach out to your tenant to see if their payment source information\r\n                can be corrected.\r\n                {% endif %}\r\n\r\n                If you have any other questions, please contact help@renttrack.com or call 866-841-9090 x2.\r\n            {% endblock %}'),(77,31,'en','fromName',NULL),(78,31,'en','fromEmail',NULL),(79,32,'en','body','{% extends \'RjComponentBundle:Mailer:base.html.twig\' %}\r\n            {% block h1 %}Rent Payment Initiated{% endblock %}\r\n            {% block email %}\r\n                Hi {{ tenantName }}! <br /><br />\r\n\r\n                Your rent payment to {{ groupName }} was just initiated.\r\n                You will receive your receipt when the payment clears, usually within 24 hours.\r\n\r\n                The details:\r\n\r\n                <table width=\'100%\' style=\'border: 1px solid #C8C8C8; border-collapse: collapse;\'>\r\n                <tbody>\r\n                <tr style=\'border: 1px solid #C8C8C8;\'>\r\n                    <td style=\'padding:5px;\'>{{ \'order.date.time\' | trans }}:</td>\r\n                    <td style=\'padding:5px;\'>{{ orderTime }}</td>\r\n                </tr>\r\n                <tr style=\'border: 1px solid #C8C8C8;\'>\r\n                    <td style=\'padding:5px;\'>{{ \'order.transaction.id\' | trans }}:</td>\r\n                    <td style=\'padding:5px;\'>{{ transactionID }}</td>\r\n                </tr>\r\n                <tr style=\'border: 1px solid #C8C8C8;\'>\r\n                    <td style=\'padding:5px;\'>{{ \'amount\' | trans }}:</td>\r\n                    <td style=\'padding:5px;\'>{{ amount }}</td>\r\n                </tr>\r\n                {% if fee > 0 %}\r\n                <tr style=\'border: 1px solid #C8C8C8;\'>\r\n                    <td style=\'padding:5px;\'>{{ \'order.fee\' | trans }}:</td>\r\n                    <td style=\'padding:5px;\'>{{ fee }}</td>\r\n                </tr>\r\n                {% else %}\r\n                <tr style=\'border: 1px solid #C8C8C8;\'>\r\n                    <td style=\'padding:5px;\'>{{ \'order.fee\' | trans }}:</td>\r\n                    <td style=\'padding:5px;\'>{{ \'order.fee.free\' | trans }}</td>\r\n                </tr>\r\n                {% endif %}\r\n                <tr style=\'border: 1px solid #C8C8C8;\'>\r\n                    <td style=\'padding:5px;\'>{{ \'order.total\' | trans }}:</td>\r\n                    <td style=\'padding:5px;\'>{{ total }}</td>\r\n                </tr>\r\n\r\n                </tbody>\r\n                </table>\r\n                </br>\r\n                {{ \'order.receipt.footer\' | trans }}\r\n            {% endblock %}'),(80,32,'en','subject','Rent Payment Initiated'),(81,32,'en','bodyHtml','{% extends \'RjComponentBundle:Mailer:base.html.twig\' %}\r\n            {% block h1 %}Rent Payment Initiated{% endblock %}\r\n            {% block email %}\r\n                Hi {{ tenantName }}! <br /><br />\r\n\r\n                Your rent payment to {{ groupName }} was just initiated.\r\n                You will receive your receipt when the payment clears, usually within 24 hours.\r\n\r\n                The details:\r\n\r\n                <table width=\'100%\' style=\'border: 1px solid #C8C8C8; border-collapse: collapse;\'>\r\n                <tbody>\r\n                <tr style=\'border: 1px solid #C8C8C8;\'>\r\n                    <td style=\'padding:5px;\'>{{ \'order.date.time\' | trans }}:</td>\r\n                    <td style=\'padding:5px;\'>{{ orderTime }}</td>\r\n                </tr>\r\n                <tr style=\'border: 1px solid #C8C8C8;\'>\r\n                    <td style=\'padding:5px;\'>{{ \'order.transaction.id\' | trans }}:</td>\r\n                    <td style=\'padding:5px;\'>{{ transactionID }}</td>\r\n                </tr>\r\n                <tr style=\'border: 1px solid #C8C8C8;\'>\r\n                    <td style=\'padding:5px;\'>{{ \'amount\' | trans }}:</td>\r\n                    <td style=\'padding:5px;\'>{{ amount }}</td>\r\n                </tr>\r\n                {% if fee > 0 %}\r\n                <tr style=\'border: 1px solid #C8C8C8;\'>\r\n                    <td style=\'padding:5px;\'>{{ \'order.fee\' | trans }}:</td>\r\n                    <td style=\'padding:5px;\'>{{ fee }}</td>\r\n                </tr>\r\n                {% else %}\r\n                <tr style=\'border: 1px solid #C8C8C8;\'>\r\n                    <td style=\'padding:5px;\'>{{ \'order.fee\' | trans }}:</td>\r\n                    <td style=\'padding:5px;\'>{{ \'order.fee.free\' | trans }}</td>\r\n                </tr>\r\n                {% endif %}\r\n                <tr style=\'border: 1px solid #C8C8C8;\'>\r\n                    <td style=\'padding:5px;\'>{{ \'order.total\' | trans }}:</td>\r\n                    <td style=\'padding:5px;\'>{{ total }}</td>\r\n                </tr>\r\n\r\n                </tbody>\r\n                </table>\r\n                </br>\r\n                {{ \'order.receipt.footer\' | trans }}\r\n            {% endblock %}'),(82,32,'en','fromName',NULL),(83,32,'en','fromEmail',NULL),(84,33,'en','body','\n            {% extends \'RjComponentBundle:Mailer:base.html.twig\' %}\n            {% block h1 %}Rent Payment Initiated{% endblock %}\n            {% block email %}\n                Dear {{ tenantName }}! <br />\n                <br />\n                Your property manager has adjusted the rent amount on your contract to {{ rentAmount }}.\n                Since the recurring payment you had set up for {{ paymentAmount }} is no longer correct,\n                we have cancelled your recurring payment.<br />\n                </br>\n                Please <a href=\'https://my.renttrack.com/\'>log in to RentTrack</a> and set up a new recurring payment.\n                Be sure to specify the correct month that your next recurring payment should count for.<br />\n                </br>\n                If you have any questions regarding this change, please contact your property manager.\n                If you have questions about setting up a new recurring payment,\n                please contact us at help@renttrack.com or call (866) 841-9090.</br>\n                </br>\n                </br>\n                </br>\n                {{ \'order.receipt.footer\' | trans }}\n            {% endblock %}'),(85,33,'en','subject','Your Rent amount was adjusted on your contract'),(86,34,'en','body','\n                {% extends \'RjComponentBundle:Mailer:base.html.twig\' %}\n                {% block email %}\n                Dear {{ tenantName }}! <br />\n                <br />\n                Thank you for purchasing your credit report through Credit Jeeves.\n                Your payment was processed successfully and will appear on your next statement.\n                Here is your receipt:<br />\n                &nbsp;<br />\n                <hr />\n                Payment Date & Time:&nbsp;{{ date }}<br />\n                Payment Amount: {{ amout }}<br />\n                Reference Number: {{ number }}<br />\n                <br />\n                </br>\n                </br>\n                {{ \'order.receipt.footer\' | trans }}\n                {% endblock %}'),(87,34,'en','subject','Receipt from Rent Track'),(88,35,'en','body','{% extends \"RjComponentBundle:Mailer:base.html.twig\" %}\n{% block h1 %}Batch Deposit Report{% endblock %}\n{% block email %}\nDear {{ landlordFirstName }}, <br />\nYour batch deposit report for <b>{{ date | date(\"m/d/Y\") }}</b> for group <b>{{ groupName }}</b>\n{% if accountNumber %}(Account #{{ accountNumber }}){% endif %} is below:<br />\n<br />\n{% if batches %}\n{% for batch in batches %}\nBatch ID: <b>{{ batch.batchId }}</b><br />\nPayment Type: <b>{{ (\'order.type.\' ~ batch.paymentType) | trans }}</b><br />\n<table width=\"100%\" style=\"border: 1px solid #4E4E4E; border-collapse: collapse;font-size: 12px;\">\n  <thead>\n    <tr>\n      <th style=\"padding:3px;border: 1px solid #4E4E4E;background: #ccc;\" nowrap>{{ \'order.transaction.id.short\' | trans }}</th>\n      <th style=\"padding:3px;border: 1px solid #4E4E4E;background: #ccc;\">{{ \'order.status\' | trans }}</th>\n      <th style=\"padding:3px;border: 1px solid #4E4E4E;background: #ccc;\">{{ \'order.resident\' | trans }}</th>\n      <th style=\"padding:3px;border: 1px solid #4E4E4E;background: #ccc;\">{{ \'payment.property\' | trans }}</th>\n      <th style=\"padding:3px;border: 1px solid #4E4E4E;background: #ccc;\">{{ \'payment.date_initiated\' | trans }}</th>\n      <th style=\"padding:3px;border: 1px solid #4E4E4E;background: #ccc;\">{{ \'amount\' | trans }}</th>\n    </tr>\n  </thead>\n  <tfoot>\n    <tr>\n       <td colspan=\"5\" style=\"padding:3px;border: 1px solid #4E4E4E;\" align=\"right\"><b>{{ \'order.total\' | trans }}:</b></td>\n       <td style=\"padding:3px;border: 1px solid #4E4E4E;\"><b>${{ batch.paymentTotal }}</b></td>\n    </tr>\n   </tfoot>\n  <tbody>\n    {% for transaction in batch.transactions %}\n    <tr>\n      <td style=\"padding:3px;border: 1px solid #4E4E4E;{{ cycle([\'background: #eee;\', \'\'], loop.index) }}\">{{ transaction.transactionId }}</td>\n      <td style=\"padding:3px;border: 1px solid #4E4E4E;{{ cycle([\'background: #eee;\', \'\'], loop.index) }}\">{{ (\'transaction.status.text.\' ~ transaction.transactionStatus) | trans }}</td>\n      <td style=\"padding:3px;border: 1px solid #4E4E4E;{{ cycle([\'background: #eee;\', \'\'], loop.index) }}\">{{ transaction.resident }}</td>\n      <td style=\"padding:3px;border: 1px solid #4E4E4E;{{ cycle([\'background: #eee;\', \'\'], loop.index) }}\">\n      {{ transaction.property }}{% if not transaction.isSingle %}{{ \' #\' ~ transaction.unitName }}{% endif %}\n      </td>\n      <td style=\"padding:3px;border: 1px solid #4E4E4E;{{ cycle([\'background: #eee;\', \'\'], loop.index) }}\">{{ transaction.dateInitiated | date(\"m/d/Y\") }}</td>\n      <td style=\"padding:3px;border: 1px solid #4E4E4E;{{ cycle([\'background: #eee;\', \'\'], loop.index) }}\">${{ transaction.amount }}</td>\n    </tr>\n    {% endfor %}\n  </tbody>\n</table>\n<br />\n{% endfor %}\n{% endif %}\n{% if returns %}\nReversals (Each will be Debited Separately)\n<table width=\"100%\" style=\"border: 1px solid #4E4E4E; border-collapse: collapse;font-size: 12px;\">\n  <thead>\n    <tr>\n      <th style=\"padding:3px;border: 1px solid #4E4E4E;background: #ccc;\" nowrap>{{ \'order.transaction.id.short\' | trans }}</th>\n      <th style=\"padding:3px;border: 1px solid #4E4E4E;background: #ccc;\">{{ \'order.status\' | trans }}</th>\n      <th style=\"padding:3px;border: 1px solid #4E4E4E;background: #ccc;\">{{ \'payment.status_message\' | trans }}</th>\n      <th style=\"padding:3px;border: 1px solid #4E4E4E;background: #ccc;\">{{ \'order.resident\' | trans }}</th>\n      <th style=\"padding:3px;border: 1px solid #4E4E4E;background: #ccc;\">{{ \'payment.property\' | trans }}</th>\n      <th style=\"padding:3px;border: 1px solid #4E4E4E;background: #ccc;\">{{ \'payment.date_reversal\' | trans }}</th>\n      <th style=\"padding:3px;border: 1px solid #4E4E4E;background: #ccc;\">{{ \'amount\' | trans }}</th>\n    </tr>\n  </thead>\n  <tbody>\n    {% for transaction in returns %}\n    <tr>\n      <td style=\"padding:3px;border: 1px solid #4E4E4E;{{ cycle([\'background: #eee;\', \'\'], loop.index) }}\">{{ transaction.transactionId }}</td>\n      <td style=\"padding:3px;border: 1px solid #4E4E4E;{{ cycle([\'background: #eee;\', \'\'], loop.index) }}\">{{ (\'order.status.text.\' ~ transaction.orderStatus) | trans }}</td>\n      <td style=\"padding:3px;border: 1px solid #4E4E4E;{{ cycle([\'background: #eee;\', \'\'], loop.index) }}\">{{ transaction.messages }}</td>\n      <td style=\"padding:3px;border: 1px solid #4E4E4E;{{ cycle([\'background: #eee;\', \'\'], loop.index) }}\">{{ transaction.resident }}</td>\n      <td style=\"padding:3px;border: 1px solid #4E4E4E;{{ cycle([\'background: #eee;\', \'\'], loop.index) }}\">\n      {{ transaction.property }}{% if not transaction.isSingle %}{{ \' #\' ~ transaction.unitName }}{% endif %}\n      </td>\n      <td style=\"padding:3px;border: 1px solid #4E4E4E;{{ cycle([\'background: #eee;\', \'\'], loop.index) }}\">{{ transaction.reversalDate | date(\"m/d/Y\") }}</td>\n      <td style=\"padding:3px;border: 1px solid #4E4E4E;{{ cycle([\'background: #eee;\', \'\'], loop.index) }}\">-${{ transaction.amount | abs }}</td>\n    </tr>\n    {% endfor %}\n  </tbody>\n</table>\n{% endif %}\n{% if not (returns and batches)  %}\nThere are no deposits to report.\n{% endif %}\n{% endblock %}'),(89,35,'en','subject','Daily Batch Deposit Report'),(90,36,'en','body','{% extends \"RjComponentBundle:Mailer:base.html.twig\" %}\n{% block h1 %}Batch Deposit Report{% endblock %}\n{% block email %}\nDear {{ landlordFirstName }}, <br />\nYour batch deposit report for <b>{{ date | date(\"m/d/Y\") }}</b> is below:\n{% for group in groups %}\n<br />\n<br />For group <b>{{ group.groupName }}</b>{% if group.accountNumber %} (Account #{{ group.accountNumber }}){% endif %}:<br />\n<br />\n{% if group.batches %}\n  {% for batch in group.batches %}\n  Batch ID: <b>{{ batch.batchId }}</b><br />\n  Payment Type: <b>{{ (\'order.type.\' ~ batch.paymentType) | trans }}</b><br />\n  <table width=\"100%\" style=\"border: 1px solid #4E4E4E; border-collapse: collapse;font-size: 12px;\">\n    <thead>\n      <tr>\n        <th style=\"padding:3px;border: 1px solid #4E4E4E;background: #ccc;\" nowrap>{{ \'order.transaction.id.short\' | trans }}</th>\n        <th style=\"padding:3px;border: 1px solid #4E4E4E;background: #ccc;\">{{ \'order.status\' | trans }}</th>\n        <th style=\"padding:3px;border: 1px solid #4E4E4E;background: #ccc;\">{{ \'order.resident\' | trans }}</th>\n        <th style=\"padding:3px;border: 1px solid #4E4E4E;background: #ccc;\">{{ \'payment.property\' | trans }}</th>\n        <th style=\"padding:3px;border: 1px solid #4E4E4E;background: #ccc;\">{{ \'payment.date_initiated\' | trans }}</th>\n        <th style=\"padding:3px;border: 1px solid #4E4E4E;background: #ccc;\">{{ \'amount\' | trans }}</th>\n      </tr>\n    </thead>\n    <tfoot>\n      <tr>\n         <td colspan=\"5\" style=\"padding:3px;border: 1px solid #4E4E4E;\" align=\"right\"><b>{{ \'order.total\' | trans }}:</b></td>\n         <td style=\"padding:3px;border: 1px solid #4E4E4E;\"><b>${{ batch.paymentTotal }}</b></td>\n      </tr>\n     </tfoot>\n    <tbody>\n      {% for transaction in batch.transactions %}\n      <tr>\n        <td style=\"padding:3px;border: 1px solid #4E4E4E;{{ cycle([\'background: #eee;\', \'\'], loop.index) }}\">{{ transaction.transactionId }}</td>\n        <td style=\"padding:3px;border: 1px solid #4E4E4E;{{ cycle([\'background: #eee;\', \'\'], loop.index) }}\">{{ (\'transaction.status.text.\' ~ transaction.transactionStatus) | trans }}</td>\n        <td style=\"padding:3px;border: 1px solid #4E4E4E;{{ cycle([\'background: #eee;\', \'\'], loop.index) }}\">{{ transaction.resident }}</td>\n        <td style=\"padding:3px;border: 1px solid #4E4E4E;{{ cycle([\'background: #eee;\', \'\'], loop.index) }}\">\n          {{ transaction.property }}{% if not transaction.isSingle %}{{ \' #\' ~ transaction.unitName }}{% endif %}\n        </td>\n        <td style=\"padding:3px;border: 1px solid #4E4E4E;{{ cycle([\'background: #eee;\', \'\'], loop.index) }}\">{{ transaction.dateInitiated | date(\"m/d/Y\") }}</td>\n        <td style=\"padding:3px;border: 1px solid #4E4E4E;{{ cycle([\'background: #eee;\', \'\'], loop.index) }}\">${{ transaction.amount }}</td>\n      </tr>\n      {% endfor %}\n    </tbody>\n  </table>\n  <br />\n  {% endfor %}\n{% endif %}\n{% if group.returns %}\n  Reversals (Each will be Debited Separately)\n  <table width=\"100%\" style=\"border: 1px solid #4E4E4E; border-collapse: collapse;font-size: 12px;\">\n    <thead>\n      <tr>\n        <th style=\"padding:3px;border: 1px solid #4E4E4E;background: #ccc;\" nowrap>{{ \'order.transaction.id.short\' | trans }}</th>\n        <th style=\"padding:3px;border: 1px solid #4E4E4E;background: #ccc;\">{{ \'order.status\' | trans }}</th>\n        <th style=\"padding:3px;border: 1px solid #4E4E4E;background: #ccc;\">{{ \'payment.status_message\' | trans }}</th>\n        <th style=\"padding:3px;border: 1px solid #4E4E4E;background: #ccc;\">{{ \'order.resident\' | trans }}</th>\n        <th style=\"padding:3px;border: 1px solid #4E4E4E;background: #ccc;\">{{ \'payment.property\' | trans }}</th>\n        <th style=\"padding:3px;border: 1px solid #4E4E4E;background: #ccc;\">{{ \'payment.date_reversal\' | trans }}</th>\n        <th style=\"padding:3px;border: 1px solid #4E4E4E;background: #ccc;\">{{ \'amount\' | trans }}</th>\n      </tr>\n    </thead>\n    <tbody>\n      {% for transaction in group.returns %}\n      <tr>\n        <td style=\"padding:3px;border: 1px solid #4E4E4E;{{ cycle([\'background: #eee;\', \'\'], loop.index) }}\">{{ transaction.transactionId }}</td>\n        <td style=\"padding:3px;border: 1px solid #4E4E4E;{{ cycle([\'background: #eee;\', \'\'], loop.index) }}\">{{ (\'order.status.text.\' ~ transaction.orderStatus) | trans }}</td>\n        <td style=\"padding:3px;border: 1px solid #4E4E4E;{{ cycle([\'background: #eee;\', \'\'], loop.index) }}\">{{ transaction.messages }}</td>\n        <td style=\"padding:3px;border: 1px solid #4E4E4E;{{ cycle([\'background: #eee;\', \'\'], loop.index) }}\">{{ transaction.resident }}</td>\n        <td style=\"padding:3px;border: 1px solid #4E4E4E;{{ cycle([\'background: #eee;\', \'\'], loop.index) }}\">\n        {{ transaction.property }}{% if not transaction.isSingle %}{{ \' #\' ~ transaction.unitName }}{% endif %}\n        </td>\n        <td style=\"padding:3px;border: 1px solid #4E4E4E;{{ cycle([\'background: #eee;\', \'\'], loop.index) }}\">{{ transaction.reversalDate | date(\"m/d/Y\") }}</td>\n        <td style=\"padding:3px;border: 1px solid #4E4E4E;{{ cycle([\'background: #eee;\', \'\'], loop.index) }}\">-${{ transaction.amount | abs }}</td>\n      </tr>\n      {% endfor %}\n    </tbody>\n  </table>\n{% endif %}\n{% if not (group.returns and group.batches) %}\nThere are no deposits to report.\n{% endif %}\n{% endfor %}\n{% endblock %}'),(91,36,'en','subject','Daily Batch Deposit Report'),(94,38,'en','body','      {% extends \"RjComponentBundle:Mailer:base.html.twig\" %}\n      {% block email %}\n        Dear {{ TenantName }},\n        Your property manager has re-enabled online payments. You can now\n        <a href=\"{{ href }}\">log into RentTrack</a> and set up a new payment.\n      {% endblock %}'),(95,38,'en','subject','Online Payments Enabled'),(96,39,'en','body','      {% extends \"RjComponentBundle:Mailer:base.html.twig\" %}\n      {% block email %}\n        Dear {{ TenantName }},\n        Your property manager has disabled online payments. Any unprocessed payments you had scheduled\n        through RentTrack have been cancelled. Contact your property manager immediately for more information.\n      {% endblock %}'),(97,39,'en','subject','Online Payments Disabled'),(98,37,'en','body','{% extends \"RjComponentBundle:Mailer:base.html.twig\" %}\n{% block email %}\n The following batch deposits for {{ data[\'deposit_date\']|date(\'Y-m-d\') }} were uploaded to your accounting system.\n Please review and post the batches.\n <br />\n <br />\n <table width=\"100%\" style=\"border: 1px solid #4E4E4E; border-collapse: collapse;font-size: 12px;\">\n   <thea