count within a couple of days. Please contact your tenant\r\n                if you have any questions regarding this refund.\r\n                {% elseif orderStatus == \'cancelled\' %}\r\n\r\n                Per your your tenant\'s request, their rent payment of {{ rentAmount }} sent on {{ orderDate }}\r\n                was cancelled. You will not see a deposit in your account since it was cancelled before\r\n                payment settlement. Please contact your tenant if you have any questions regarding this cancellation.\r\n                {% else %}\r\n\r\n                Your tenant\'s payment of {{ rentAmount }} sent on {{ orderDate }} was returned. This amount\r\n                has been deducted from your account per the RentTrack terms of service. Your rent is currently not paid.\r\n                Please contact your tenant if to arrange another payment.\r\n\r\n\r\n                RentTrack Customer Support will also reach out to your tenant to see if their payment source information\r\n                can be corrected.\r\n                {% endif %}\r\n\r\n                If you have any other questions, please contact help@renttrack.com or call 866-841-9090 x2.\r\n            {% endblock %}\";}','darryl+admin@creditjeeves.com'),(40,'create','2014-02-19 08:18:42','77','Rj\\EmailBundle\\Entity\\EmailTemplateTranslation',1,'a:3:{s:6:\"locale\";s:2:\"en\";s:8:\"property\";s:8:\"fromName\";s:5:\"value\";N;}','darryl+admin@creditjeeves.com'),(41,'create','2014-02-19 08:18:42','78','Rj\\EmailBundle\\Entity\\EmailTemplateTranslation',1,'a:3:{s:6:\"locale\";s:2:\"en\";s:8:\"property\";s:9:\"fromEmail\";s:5:\"value\";N;}','darryl+admin@creditjeeves.com'),(42,'update','2014-02-19 08:18:42','74','Rj\\EmailBundle\\Entity\\EmailTemplateTranslation',1,'a:1:{s:5:\"value\";s:1557:\"{% extends \'RjComponentBundle:Mailer:base.html.twig\' %}\r\n            {% block h1 %}Dear {{ landlordFirstName }},{% endblock %}\r\n            {% block email %}\r\n                {% if orderStatus == \'refunded\' %}\r\n\r\n                Per your tenant\'s request, their rent of {{ rentAmount }} sent on {{ orderDate }} was refunded\r\n                and will be deducted from your account within a couple of days. Please contact your tenant\r\n                if you have any questions regarding this refund.\r\n                {% elseif orderStatus == \'cancelled\' %}\r\n\r\n                Per your your tenant\'s request, their rent payment of {{ rentAmount }} sent on {{ orderDate }}\r\n                was cancelled. You will not see a deposit in your account since it was cancelled before\r\n                payment settlement. Please contact your tenant if you have any questions regarding this cancellation.\r\n                {% else %}\r\n\r\n                Your tenant\'s payment of {{ rentAmount }} sent on {{ orderDate }} was returned. This amount\r\n                has been deducted from your account per the RentTrack terms of service. Your rent is currently not paid.\r\n                Please contact your tenant if to arrange another payment.\r\n\r\n\r\n                RentTrack Customer Support will also reach out to your tenant to see if their payment source information\r\n                can be corrected.\r\n                {% endif %}\r\n\r\n                If you have any other questions, please contact help@renttrack.com or call 866-841-9090 x2.\r\n            {% endblock %}\";}','darryl+admin@creditjeeves.com'),(43,'create','2014-02-24 17:47:15','81','Rj\\EmailBundle\\Entity\\EmailTemplateTranslation',1,'a:3:{s:6:\"locale\";s:2:\"en\";s:8:\"property\";s:8:\"bodyHtml\";s:5:\"value\";s:2155:\"{% extends \'RjComponentBundle:Mailer:base.html.twig\' %}\r\n            {% block h1 %}Rent Payment Initiated{% endblock %}\r\n            {% block email %}\r\n                Hi {{ tenantName }}! <br /><br />\r\n\r\n                Your rent payment to {{ groupName }} was just initiated.\r\n                You will receive your receipt when the payment clears, usually within 24 hours.\r\n\r\n                The details:\r\n\r\n                <table width=\'100%\' style=\'border: 1px solid #C8C8C8; border-collapse: collapse;\'>\r\n                <tbody>\r\n                <tr style=\'border: 1px solid #C8C8C8;\'>\r\n                    <td style=\'padding:5px;\'>{{ \'order.date.time\' | trans }}:</td>\r\n                    <td style=\'padding:5px;\'>{{ orderTime }}</td>\r\n                </tr>\r\n                <tr style=\'border: 1px solid #C8C8C8;\'>\r\n                    <td style=\'padding:5px;\'>{{ \'order.transaction.id\' | trans }}:</td>\r\n                    <td style=\'padding:5px;\'>{{ transactionID }}</td>\r\n                </tr>\r\n                <tr style=\'border: 1px solid #C8C8C8;\'>\r\n                    <td style=\'padding:5px;\'>{{ \'amount\' | trans }}:</td>\r\n                    <td style=\'padding:5px;\'>{{ amount }}</td>\r\n                </tr>\r\n                {% if fee > 0 %}\r\n                <tr style=\'border: 1px solid #C8C8C8;\'>\r\n                    <td style=\'padding:5px;\'>{{ \'order.fee\' | trans }}:</td>\r\n                    <td style=\'padding:5px;\'>{{ fee }}</td>\r\n                </tr>\r\n                {% else %}\r\n                <tr style=\'border: 1px solid #C8C8C8;\'>\r\n                    <td style=\'padding:5px;\'>{{ \'order.fee\' | trans }}:</td>\r\n                    <td style=\'padding:5px;\'>{{ \'order.fee.free\' | trans }}</td>\r\n                </tr>\r\n                {% endif %}\r\n                <tr style=\'border: 1px solid #C8C8C8;\'>\r\n                    <td style=\'padding:5px;\'>{{ \'order.total\' | trans }}:</td>\r\n                    <td style=\'padding:5px;\'>{{ total }}</td>\r\n                </tr>\r\n\r\n                </tbody>\r\n                </table>\r\n                </br>\r\n                {{ \'order.receipt.footer\' | trans }}\r\n            {% endblock %}\";}','darryl+admin@creditjeeves.com'),(44,'create','2014-02-24 17:47:15','82','Rj\\EmailBundle\\Entity\\EmailTemplateTranslation',1,'a:3:{s:6:\"locale\";s:2:\"en\";s:8:\"property\";s:8:\"fromName\";s:5:\"value\";N;}','darryl+admin@creditjeeves.com'),(45,'create','2014-02-24 17:47:15','83','Rj\\EmailBundle\\Entity\\EmailTemplateTranslation',1,'a:3:{s:6:\"locale\";s:2:\"en\";s:8:\"property\";s:9:\"fromEmail\";s:5:\"value\";N;}','darryl+admin@creditjeeves.com'),(46,'update','2014-02-24 17:47:15','79','Rj\\EmailBundle\\Entity\\EmailTemplateTranslation',1,'a:1:{s:5:\"value\";s:2155:\"{% extends \'RjComponentBundle:Mailer:base.html.twig\' %}\r\n            {% block h1 %}Rent Payment Initiated{% endblock %}\r\n            {% block email %}\r\n                Hi {{ tenantName }}! <br /><br />\r\n\r\n                Your rent payment to {{ groupName }} was just initiated.\r\n                You will receive your receipt when the payment clears, usually within 24 hours.\r\n\r\n                The details:\r\n\r\n                <table width=\'100%\' style=\'border: 1px solid #C8C8C8; border-collapse: collapse;\'>\r\n                <tbody>\r\n                <tr style=\'border: 1px solid #C8C8C8;\'>\r\n                    <td style=\'padding:5px;\'>{{ \'order.date.time\' | trans }}:</td>\r\n                    <td style=\'padding:5px;\'>{{ orderTime }}</td>\r\n                </tr>\r\n                <tr style=\'border: 1px solid #C8C8C8;\'>\r\n                    <td style=\'padding:5px;\'>{{ \'order.transaction.id\' | trans }}:</td>\r\n                    <td style=\'padding:5px;\'>{{ transactionID }}</td>\r\n                </tr>\r\n                <tr style=\'border: 1px solid #C8C8C8;\'>\r\n                    <td style=\'padding:5px;\'>{{ \'amount\' | trans }}:</td>\r\n                    <td style=\'padding:5px;\'>{{ amount }}</td>\r\n                </tr>\r\n                {% if fee > 0 %}\r\n                <tr style=\'border: 1px solid #C8C8C8;\'>\r\n                    <td style=\'padding:5px;\'>{{ \'order.fee\' | trans }}:</td>\r\n                    <td style=\'padding:5px;\'>{{ fee }}</td>\r\n                </tr>\r\n                {% else %}\r\n                <tr style=\'border: 1px solid #C8C8C8;\'>\r\n                    <td style=\'padding:5px;\'>{{ \'order.fee\' | trans }}:</td>\r\n                    <td style=\'padding:5px;\'>{{ \'order.fee.free\' | trans }}</td>\r\n                </tr>\r\n                {% endif %}\r\n                <tr style=\'border: 1px solid #C8C8C8;\'>\r\n                    <td style=\'padding:5px;\'>{{ \'order.total\' | trans }}:</td>\r\n                    <td style=\'padding:5px;\'>{{ total }}</td>\r\n                </tr>\r\n\r\n                </tbody>\r\n                </table>\r\n                </br>\r\n                {{ \'order.receipt.footer\' | trans }}\r\n            {% endblock %}\";}','darryl+admin@creditjeeves.com'),(47,'update','2014-02-24 17:47:29','80','Rj\\EmailBundle\\Entity\\EmailTemplateTranslation',1,'a:1:{s:5:\"value\";s:22:\"Rent Payment Initiated\";}','darryl+admin@creditjeeves.com');
